<pre><code>[
  my_arr:[
    {
      id: ObjectId('618f7ef057c2923be10d1111')
      //other stuff
    },
    {},
    {},
  ]
]
</code></pre>
<p>Is there a way to remove the empty object directly in the aggregation? or it is necessary to do it server side? I get that after doing an unwind and a group.</p>; Answer: You need to ask a more fundamental question: why do you think that signal and slots necessarily have anything to do with event loops? In your case, a signal-slot connection is **exactly like** using a function pointer. The slot is called from within the signal's body. By the time the signal returns (it's just a method, after all), the slot has been called. Nowhere in this do any event loops appear. Event loops are used to deliver cross-thread/queued slot calls, but you're not doing that.

