label: &quot;pineapple&quot;
votes: 0
3: Object
label: &quot;mango&quot;
votes: 0
</code></pre>
<p>That is how it looks in the MongoDB database. That is just its field. It is inside of a bigger doc.</p>
<p><a href="https://mongoosejs.com/docs/documents.html#updating-using-save" rel="nofollow noreferrer">This MongoDB documentation page</a> claims I can use doc.save() to accomplish my goal. It doesn't work, sending Postman requests to increment the poll over and over don't work.</p>
